window.bookSummaryJSON = "<p>Delve into the history of the sinister Count Dooku in this audio original set in a galaxy far, far away....</p> <p>Darth Tyranus. Count of Serenno. Leader of the Separatists. A red saber, unsheathed in the dark. But who was he before he became the right hand of the Sith? As Dooku courts a new apprentice, the hidden truth of the Sith Lord’s past begins to come to light. </p> <p>Dooku’s life began as one of privilege - born within the stony walls of his family’s estate, orbited by the Funeral Moon where the bones of his ancestors lie interred. But soon, his Jedi abilities are recognized, and he is taken from his home to be trained in the ways of the Force by the legendary Master Yoda.</p> <p>As he hones his power, Dooku rises through the ranks, befriending fellow Jedi Sifo-Dyas and taking a Padawan of his own, the promising Qui-Gon Jinn - and tries to forget the life that he once led. But he finds himself drawn by a strange fascination with the Jedi Master Lene Kostana, and the mission she undertakes for the Order: finding and studying ancient relics of the Sith, in preparation for the eventual return of the deadliest enemies the Jedi have ever faced.</p> <p>Caught between the world of the Jedi, the ancient responsibilities of his lost home, and the alluring power of the relics, Dooku struggles to stay in the light - even as the darkness begins to fall.</p> <p><b>Narrated by a full cast:</b> </p> <p>Orlagh Cassidy as Asajj Ventress</p> <p>Euan Morton as Dooku </p> <p>Pete Bradbury as Gretz Droom</p> <p>Jonathan Davis as Qui-Gon Jinn</p> <p>Neil Hellegers as Ramil</p> <p>Sean Kenin as Sifo-Dyas</p> <p>January LaVoy as Jor Aerith</p> <p>Saskia Maarleveld as Jenza</p> <p>Carol Monda as Lene Kostana</p> <p>Robert Petkoff as Ky Narec</p> <p>Rebecca Soler as Yula Braylon</p> <p>and </p> <p>Marc Thompson as Yoda </p>"; 
